THE GIRL FROM UNCLE -1x02- The Prisoner Of Zalamar Affair  9/20/1966

Zalamar is a tiny but very important Arabian State. Mark is there to protect it&amp;#039;s ruler, Ali Hassen, after rumors of trouble. Unfortunately, Mark is unsuccessful. Ali Hassen succumbs to poisoned popcorn and his daughter, Fatima, who is next in line to rule, is kidnapped. April, a dead ringer for Fatima, is sent to Zalamar to impersonate Fatima until she can be found and released from her captors.

Act I &quot;Baubles, Bungles and Bangs&quot;
Act II &quot;...a Sheikess by any other name...&quot;
Act III &quot;That&amp;#039;s fate, Mr. Slate&quot;
Act IV &quot;One scoop or two?&quot;

Stars: Stefanie Powers (April Dancer), Leo G. Carroll (Alexander Waverly)
Guest Stars:  Brenda Benet (Gizelle),  Michael Ansara (Vizier), Henry Calvin (Sheik Ali Hassen), Richard Hale (High Priest),  Vincent Beeck (Cassim),  Jason Wingreen (Fahd), Rafael Campos (About), John Gabriel (Prince Ahmed), Abraham Sofaer (Omar)
Original Air Date: 20 September 1966

